import React from "react";
import './App.css';


function App() {
    return (
        <div>
            <header>
                <img
                    src="https://image.shutterstock.com/image-vector/mountain-vector-icon-isolated-on-260nw-1199231911.jpg"/>
            </header>
            <nav>
                <div>
                    Profile
                </div>
                <div>
                    Messages
                </div>
            </nav>

        </div>
    );
}

export default App;
